import React from "react";
import {City} from "./CityDTO";

interface iProps {
  city: City;
}
function CityCard(props: iProps) {
  return <div>
    <div>iProps.city.name</div>
    <div>iProps.city.timestamp</div>
    <div>iProps.temperature</div>
    <div>iProps.title</div>
  </div>;
}
export default CityCard;
